import React from 'react';
import {
  Container,
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  SideNavRail,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
  SideNavItem,
} from 'carbon-components-react';
import './_pz-sidenavSet.scss';

const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};


function PzSidenavSet(props) {
  return (
  <div>
    <HeaderContainer
      render={({ isSideNavExpanded, onClickSideNavExpand }) => (
        <SideNav className="SideNav">
           <SideNavItems>
              <SideNavMenuItem href={props.link}>
                {props.icon}
                {props.title}
              </SideNavMenuItem>
            </SideNavItems>
        </SideNav> 
      )
      }
    />
  </div>
  );
};



export default PzSidenavSet

